/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div	data-sap-ui-fastnavgroup="true"	class="ui5-panel-root"	role="${ifDefined(context.accRole)}"><!-- header: either header or h1 with header text --><div		@click="${context._headerClick}"		@keydown="${context._headerKeyDown}"		@keyup="${context._headerKeyUp}"		class="ui5-panel-header"		tabindex="${ifDefined(context.headerTabIndex)}"		role="${ifDefined(context.accInfo.role)}"		aria-expanded="${ifDefined(context.accInfo.ariaExpanded)}"		aria-controls="${ifDefined(context.accInfo.ariaControls)}"	><div			class="ui5-panel-header-button-root"		><ui5-button				design="Transparent"				class="ui5-panel-header-button ${classMap(context.classes.headerBtn)}"				icon="navigation-right-arrow"				?non-focusable="${context.nonFocusableButton}"				@click="${context._toggleButtonClick}"				._buttonAccInfo="${ifDefined(context.accInfo.button)}"			></ui5-button></div>		${ context._hasHeader ? block1(context) : block2(context) }</div><!-- content area --><div class="ui5-panel-content" id="${ifDefined(context._id)}-content" tabindex="-1" style="${styleMap(context.styles.content)}"><slot></slot></div></div>`; };
const block1 = (context) => { return html`<slot name="header"></slot>		`; };
const block2 = (context) => { return html`<div				role="heading"				aria-level="${ifDefined(context.headerAriaLevel)}"				class="ui5-panel-header-title"			>				${ifDefined(context.headerText)}</div>		`; };

export default block0;
